const presetImagesMap = new Map();
presetImagesMap.set(
  'exit',
  '',
);
presetImagesMap.set(
  'warning',
  '',
);
presetImagesMap.set(
  '404',
  '',
);

export default function icon(icon: string) {
  return presetImagesMap.has(icon) ? `data:image/png;base64,${presetImagesMap.get(icon)}` : icon;
}
